import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
// import * as serviceWorker from './serviceWorker';
import {createStore} from 'redux';

const changeWhosOnFirst = (value) => {
  return {
    type: 'CHANGETM',
    value
  }
};

const tmReducer = (state = '', action) => {
  switch (action.type) {
    case "CHANGETM":
      return action.value;
    default:
      return state;
  }
};

//STORE
let store = createStore(tmReducer);
store.subscribe(() => {console.log(store.getState())});
//DISPATCH
store.dispatch(changeWhosOnFirst('Jorie'));

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

